The problem is that the `Tooltip` component is not aware of the other `Tooltip` components. So when a new `Tooltip` is opened, the previously opened one is not closed.

I'm trying to find a way to close the previously opened `Tooltip` when a new one is opened.

I was thinking of using a `ref` to keep track of the opened `Tooltip` and then close it when a new one is opened. But I'm not sure if this is the best approach.

Any help would be appreciated.

Answer:

I was able to solve the problem by using a `ref` to keep track of the opened `Tooltip` and then close it when a new one is opened.

Here is the updated code:

\begin{code}
import React, { useRef, useState, createContext, useContext } from 'react';

const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);
  const tooltipRef = useRef(null);

  const openTooltip = (tooltip) => {
    if (tooltipRef.current) {
      tooltipRef.current.closeTooltip();
    }
    setTooltip(tooltip);
    tooltipRef.current = tooltip;
  };

  const closeTooltip = () => {
    setTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ openTooltip, closeTooltip, tooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export const useTooltip = () => {
  return useContext(TooltipContext);
};

export const Tooltip = ({ children }) => {
  const { openTooltip, closeTooltip, tooltip } = useTooltip();

  const handleMouseOver = () => {
    openTooltip({ closeTooltip, children });
  };

  const handleMouseOut = () => {
    closeTooltip();
  };

  return (
    <>

        {children}

      {tooltip && tooltip.children === children && (
        <TooltipContent>{tooltip.children}</TooltipContent>
      )}
    </>
  );
};
\`

In this updated code, I added a `tooltipRef` to keep track of the opened `Tooltip`. When a new `Tooltip` is opened, I check if there is a previously opened `Tooltip` and close it if it exists. Then I update the `tooltipRef` to point to the newly opened `Tooltip`.

This way, when a new `Tooltip` is opened, the previously opened one is closed.
\end{code}

